import Home from "../pages/Home";
import Product from "../pages/Product";
import Products from "../pages/Products";

const mainRoutes = [
  {
    path: "currency",
    children: [
      {
        index: true,
        element: <Products />,
      },
      {
        path: ":productId",
        element: <Product />,
      },
    ],
  },
];

export default mainRoutes;
